import logo from './logo.svg';
import './App.css';
import  './components/Component.css';
import  './login/Login.css';

function App() {
  return (
    <div>        
            <div className="login_box">
                <div className="login_logo">
                    <h1>OpenSales</h1>
                </div>
                <div className="login_form">
                    <fieldset className="login_field">
                        <form method="post">
                            <div className="account_txt">아이디</div>
                            <div className="account_input"><input type="text" placeholder="아이디"></input></div>
                            <div className="password_txt">비밀번호</div>
                            <div className="password_input"><input type="password" placeholder="비밀번호"></input></div>
                            <div className="submit_btn">
                                <input className="button_submit" type="submit" value="로그인"></input>
                            </div>
                            <div className="find_account_div">
                                <span className="find_account"><a href="#">아이디 찾기</a></span>
                            </div>
                        </form>
                    </fieldset>
                </div>
            </div>
        </div>

  );
}

export default App;
